"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.default=void 0;var e=n(require("react")),t=require("../../scripts/components");function a(e){if("function"!=typeof WeakMap)return null;var t=new WeakMap,n=new WeakMap;return(a=function(e){return e?n:t})(e)}function n(e,t){if(!t&&e&&e.__esModule)return e;if(null===e||"object"!=typeof e&&"function"!=typeof e)return{default:e};var n=a(t);if(n&&n.has(e))return n.get(e);var r={},o=Object.defineProperty&&Object.getOwnPropertyDescriptor;for(var i in e)if("default"!==i&&Object.prototype.hasOwnProperty.call(e,i)){var l=o?Object.getOwnPropertyDescriptor(e,i):null;l&&(l.get||l.set)?Object.defineProperty(r,i,l):r[i]=e[i]}return r.default=e,n&&n.set(e,r),r}var r="https://github.com/AngleSharp/anglesharp.github.io/tree/main/docs/blog/2018-01-03-anglesharp-v099-released.md",o='\n<p>For over a year the development of AngleSharp was stale. But the project is not dead! Today I am proud to release a hotfix to the very successful version v0.9.9, called v0.9.9.1. This hotfix contains some critical fixes and improvements. It also paves the way for the v0.10 release, which is stuck with an observer problem (namely how to attach dynamic listeners to attribute changes for - from the perspective of AngleSharp.Core - unknown attributes), which is solved in this hotfix. In the long term this also enables users to disable the dynamic DOM, resulting in even better performance for static analysis when a fully dynamic DOM is not needed.</p>\n<p>One of the things that kept AngleSharp stale was the issue of the broken tool chain. Essentially, .NET Core broke earlier behavior and as there was no global.json available the latest SDK was used by AppVeyor. Thus our build was not working (on AppVeyor, or many newer platforms that missed the required SDK) anymore. Now we specify the right SDK and also fully support Linux builds (at least WSL compatible), which had some minor issues previously.</p>\n<p>AngleSharp is already quite in use and popular these days. The NuGet statistic of downloads per day also confirms this.</p>\n<p><img src="'+require("../../../../../images/nuget_stat_day.png")+'" alt="AngleSharp downloads per day"></p>\n<p>More importantly, the overall number of downloads is pretty much constantly increasing. Thus we do not see any decline in AngleSharp\'s usage. However, increasing the number of downloads per day (i.e., stepping back in the arena with HtmlAgilityPack) will be an important goal for 2018.</p>\n<p><img src="'+require("../../../../../images/nuget_stat_total.png")+'" alt="AngleSharp downloads in total"></p>\n<p>To achieve this goal we will try to finally publish v0.10. If this can be done in the first half of 2018 then the way for v1 is definitely free. For v1 we will try to improve / realize</p>\n<ul>\n<li>a better JS engine integration (e.g., capable of Angular, React, ...),</li>\n<li>finished AngleSharp.Css (at least API-wise),</li>\n<li>more complete AngleSharp.Io package (including file and directory upload options etc.),</li>\n<li>a very simple renderer, and</li>\n<li>a very complete NuGet package that hosts everything combined (AngleSharp.Browser).</li>\n</ul>\n<p>Let\'s see what can be done! Happy new year everyone and thanks for using AngleSharp.</p>\n',i=function(){return e.createElement(t.ContentPage,null,e.createElement(t.PageContent,{meta:{title:"AngleSharp v0.9.9.1 released",date:"2018-01-03 16:01:00",categories:"news release hotfix",author:"Florian Rappl"}},e.createElement(t.Markdown,{content:o,link:r,editLabel:"Edit on GitHub"})))};exports.default=i;
